import './Song.css';

function Song(props){
  return (
    <div>
    <div className='song' >
      <div className='songRank'>
        {props.rank}. 
      </div>
      <div className='songImageBody'>
        <img className='songImage' src={props.image}/>
      </div>
      <div className='songDetails'>
        <div className='songTitle'><b>{props.title}</b></div>
        <div className='songArtist'>{props.artist}</div>
      </div>
    </div>
    </div>
  );
}

export default Song;
